import React from 'react'
import styled from 'styled-components'


const aju=styled.div`
    max-width:550px;
    display:flex;
    flex-direction:column;
    width:100%;
    border:1px solid ${({theme})=> theme.text_secondary + 90};
    
    border-radius:8px;
    padding:8px;
    color:inherit;
    background:${({theme})=>theme.bg}
    cursor: pointer;
    gap: 6px;
    align-items:center;
`

const SearchBar = ({label,placeholder,name,rows}) => {
  return (<>
   
  
     <label >{label}</label> 
    <Raju>
    <textarea 
    id={name}
    name={name}
    placeholder={placeholder}
    rows={rows}
     
        
    /></Raju>
  
  </>
  )
}

export default SearchBar;
